import React from 'react';

const Profile = () => {
  return (
    <div className="flex items-center justify-center h-screen bg-gradient-to-b from-blue-500 to-red-400">
      <div className="bg-white rounded-xl shadow-lg p-8 w-full max-w-md">
        <div className="flex flex-col items-center">
          <img
            src="https://via.placeholder.com/100"
            alt="Profile"
            className="w-24 h-24 rounded-full border-4 border-blue-500 shadow-md"
          />
          <h2 className="mt-4 text-2xl font-semibold text-gray-800">Marsya Putra</h2>
          <p className="text-gray-500">Student ID: 2702367220</p>
          <p className="text-gray-500">Marsya.putra@binus.ac.id</p>



          <button className="mt-6 bg-gradient-to-r from-blue-500 to-red-400 text-white py-2 px-6 rounded-full shadow-md hover:from-blue-600 hover:to-red-500 transition duration-300">
            Show more
          </button>
          <button
            onClick={() => window.location.href = '/'}
            className="mt-4 text-blue-500 hover:underline"
          >
            Back to Home
          </button>
        </div>
      </div>
    </div>
  );
};

export default Profile;
